import ear from '../images/ear.png';
import { Image } from 'react-bootstrap';

const Background = () => {
  return (
    <div className='background-ear'>
      <Image src={ear} className='ear e-50'/>
      <Image src={ear} className='ear e-60'/>
      <Image src={ear} className='ear e-70'/>
      <Image src={ear} className='ear e-80'/>
      <Image src={ear} className='ear e-90'/>
    </div>
  );
}

export default Background;
